exports=async function(bid,options){const{parseCatalogPaginate,getSelectLastOption}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`https://www.ych009.com/${bid}/list-${page}.html`,"dl.panel-chapterlist",{...options,clientOptions,pageSize:20,totalPagesRegex:html=>getSelectLastOption(html,s=>-1!==s.indexOf("\u7AE0"))?.subRegex(/-(\d+)\.html"/)?.intValue(),idRegex:/\/(?<id>[a-z\d]+)\.html/})};